// Breadcrumb.js

import React from "react";

const Breadcrumb = ({ selectedRow }) => {
  const renderBreadcrumb = () => {
    if (!selectedRow) return null;

    const path = selectedRow.path.split("/");
    const breadcrumbItems = path.map((item, index) => (
      <span key={index}>
        {item}
        {index !== path.length - 1 && <span> / </span>}
      </span>
    ));

    return <div className="breadcrumb">{breadcrumbItems}</div>;
  };

  return <div>{renderBreadcrumb()}</div>;
};

export default Breadcrumb;
